import React from 'react';
import {BrowserRouter, Switch, Route} from 'react-router-dom';

import './App.css';

function App() {
  return (
    <div className="App">
    <BrowserRouter>
    <Switch>
      <Route exact path="/askquestion">
        Hello
      </Route>
    </Switch>
      
    </BrowserRouter>
    </div>
  );
}

export default App;
